/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `update_customer_balance_trigger` AFTER UPDATE ON `invoices` FOR EACH ROW BEGIN
    DECLARE old_owed DECIMAL(10, 2);
    DECLARE new_owed DECIMAL(10, 2);
    DECLARE balance_change DECIMAL(10, 2);

    -- Calculate the old and new owed amounts
    SET old_owed = OLD.total_sales - OLD.received;
    SET new_owed = NEW.total_sales - NEW.received;

    -- Calculate the change in owed amount
    SET balance_change = new_owed - old_owed;

    -- Update the customer's balance
    UPDATE customer
    SET balance = balance + balance_change
    WHERE customer_id = NEW.customer_id;
END */;;
DELIMITER ;
