/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `update_customer_balance_after_invoice_delete` AFTER DELETE ON `invoices` FOR EACH ROW BEGIN
    DECLARE owed_amount DECIMAL(10, 2);

    -- Calculate the owed amount
    SET owed_amount = OLD.total_sales - OLD.received;

    -- Update the customer's balance by subtracting the owed amount
    UPDATE customer
    SET balance = balance - owed_amount
    WHERE customer_id = OLD.customer_id;
END */;;
