/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `update_vendor_balance_trigger` AFTER UPDATE ON `purchase order` FOR EACH ROW BEGIN
    DECLARE old_debt DECIMAL(10, 2);
    DECLARE new_debt DECIMAL(10, 2);
    DECLARE balance_change DECIMAL(10, 2);

    -- Calculate the old and new owed amounts
    SET old_debt = OLD.Total_amount - OLD.Amount_Paid;
    SET new_debt = NEW.total_amount - NEW.Amount_Paid;

    -- Calculate the change in owed amount
    SET balance_change = new_debt - old_debt;

    -- Update the customer's balance
    UPDATE vendors
    SET Debt = Debt + balance_change
    WHERE vendor_id = NEW.vendor_id;
END */;;
