/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `update_vendor_debt_after_po_delete` AFTER DELETE ON `purchase order` FOR EACH ROW BEGIN
    DECLARE owed_amount DECIMAL(10, 2);

    -- Calculate the owed amount
    SET owed_amount = OLD.Total_amount - OLD.Amount_Paid;

    -- Update the customer's balance by subtracting the owed amount
    UPDATE vendors
    SET Debt = Debt - owed_amount
    WHERE vendor_id = OLD.vendor_id;
END */;;
